	public override bool Sempred(RuleContext _localctx, int ruleIndex, int predIndex) {
		switch (ruleIndex) {
		case 2255 : return REMARK_COMMENT_sempred(_localctx, predIndex);

		case 2256 : return PROMPT_MESSAGE_sempred(_localctx, predIndex);

		case 2257 : return START_CMD_sempred(_localctx, predIndex);
		}
		return true;
	}
	private bool REMARK_COMMENT_sempred(RuleContext _localctx, int predIndex) {
		switch (predIndex) {
		case 0: return IsNewlineAtPos(-4);
		}
		return true;
	}
	private bool PROMPT_MESSAGE_sempred(RuleContext _localctx, int predIndex) {
		switch (predIndex) {
		case 1: return IsNewlineAtPos(-4);
		}
		return true;
	}
	private bool START_CMD_sempred(RuleContext _localctx, int predIndex) {
		switch (predIndex) {
		case 2: return IsNewlineAtPos(-2);
		}
		return true;
	}

